module.exports = "<section class=\"custom-page-wrap clearfix\"><div class=\"container\"><div class=\"custom-page-content clearfix\"><h1 align=\"center\" style=\"text-align: center;\">About Company</h1> <p>&nbsp;</p> <p><strong>Cartigo is one of the leading online Shopping/Ecommerce portal. Founded in 2020 with Headquarter in Ranchi(Jharkhand), it has been working to serve its customers in terms of providing the very best food products, breverages, essentials and home accessories etc. We are thrilled to be a part of the quirky and fair-trade wing of the e-commerce industry. We hope you enjoy our products as much as we enjoy offering them to you. If you have any questions or comments, please do not hesitate to contact us.</strong></p> <p>&nbsp;</p> <h4><span style=\"color: rgb(90, 93, 157);\">For Customers:</span></h4> <p>The world is undergoing profound change. With the new model of service based industry, Cartigo aims to offer a vast range of food products, snacks &amp; beverages, daily essentials, fashions products, electronic goods and home equipment’s in Jharkhand(India).</p> <p>With this play on words, the company emphasizes its intention to provide excellent prices for products.&nbsp; We are also a stockist for some of the world-renowned brands such as Ashirwad, Godrej, Dabur, Bajaj, Tata and many DIY products and solutions. Our complete range can be availed through our online portal or our comprehensive product catalog available at our stores or with one of our sales representatives.</p> <p>Four&nbsp;culture principles&nbsp;underpin the achievement of these goals:</p> <ul><li>Be stronger together!</li> <li>Get the customer excited!</li> <li>Unleash innovation!&nbsp;</li> <li>Think and act long term!&nbsp;</li></ul> <p>The corporate purpose and four culture principles are integral to <strong>Cartigo's new strategy “ E-commerce 2021 &amp; Beyond”</strong>.</p> <p>&nbsp;</p> <h4><span style=\"color: rgb(90, 93, 157);\">For Shopkeepers:</span></h4> <p>Start your marketplace with Cartigo multiseller&nbsp; solution platform and give more visibility to various brands or sellers on your store. We at Cartigo ensures more \"Growth &amp; Visibility of your products and enhance shopping\"</p></div></div></section>\n<app-footer></app-footer>";

