"use strict";
module.exports = "\n<div class=\"container\"><div class=\"breadcrumb\"><ul class=\"list-inline\"><li>\n  <a routerLink=\"/home\">Home</a></li> <li><a routerLink=\"/dashboard\">My Account</a></li> \n  <li><a routerLink=\"/myorders\">My Orders</a></li> \n  <li class=\"active\">View Order</li></ul></div></div>\n  <ngx-spinner  bdColor = \"#eeeeee73\" size = \"default\" color = \"#000\" type = \"ball-clip-rotate\" [fullScreen] = \"false\"><p style=\"color: black\" >  Loading... </p></ngx-spinner>\n\n  <section class=\"order-details-wrap\"><div class=\"container\">\n    <div class=\"order-details-top\"><h3 class=\"section-title\">View Order</h3> \n    <div class=\"row\"><div class=\"col-lg-6 col-sm-18\"><div class=\"order-information\">\n    <h4>Order Information</h4> <ul class=\"list-inline order-information-list\"><li>\n     <label>Phone:</label> <span>{{arrOrder.customer_phone}}</span></li> <li><label>Email:</label>\n     <span>{{arrOrder.customer_email}}</span></li> <li><label>Date:</label> <span> {{ arrOrder.created_at | date: \"mediumDate\" }}</span></li>\n     <li><label>Shipping Method:</label> <span>{{arrOrder.shipping_method}}</span></li> <li><label>Payment Method:</label>\n     <span>{{arrOrder.payment_method}}</span></li></ul></div></div> <div class=\"col-lg-6 col-sm-9\">\n      <div class=\"order-billing-details\"><h4>Billing Address</h4> <address><span>{{arrOrder.billing_first_name}} {{arrOrder.billing_last_name}}</span>\n      <span>{{arrOrder.billing_address_1}}</span> <span>{{arrOrder.billing_city}}, {{arrOrder.billing_state_name}} {{arrOrder.billing_zip}}</span> \n    <span>{{arrOrder.billing_city}}</span></address></div></div> <div class=\"col-lg-6 col-sm-9\">\n      <div class=\"order-shipping-details\"><h4>Shipping Address</h4> <address><span> {{arrOrder.shipping_first_name}} {{arrOrder.shipping_last_name}} </span> \n     <span>{{arrOrder.shipping_address_1}}</span>  <span *ngIf=\"arrOrder.shipping_address_2\">{{arrOrder.shipping_address_2}}</span> <span>{{arrOrder.shipping_city}}, {{arrOrder.shipping_state}} {{arrOrder.shipping_zip}}</span> \n     <span>{{arrOrder.shipping_country}}</span></address></div></div></div></div> <div class=\"order-details-middle\">\n     <div class=\"table-responsive\"><table class=\"table table-borderless order-details-table\">\n      <thead><tr><th>PRODUCT NAME</th> <th>UNIT PRICE</th> <th>QUANTITY</th> \n       <th>LINE TOTAL</th></tr></thead> <tbody>\n        <tr *ngFor=\"let prod of arrOrder.products\">\n           <td>\n      <a href=\"javascript:void(0)\" \n      class=\"product-name\">\n {{prod.product.name}}\n</a>\n<ul *ngIf=\"prod.options.length>0\" class=\"list-inline product-options\">\n  <li><label>{{prod.options[0].option.name}}:</label> {{prod.options[0].value}}\n</li></ul>\n\n\n</td> <td> <label>UNIT PRICE</label> <span class=\"product-price\">\n    {{prod.unit_price.formatted}}\n</span></td> <td><label>QUANTITY</label> <span class=\"quantity\">\n    {{prod.qty}}\n</span></td> <td><label>LINE TOTAL</label> <span class=\"product-price\">\n    {{prod.line_total.formatted}}\n</span></td></tr></tbody></table></div></div> <div class=\"order-details-bottom\">\n  <ul class=\"list-inline order-summary-list\"><li><label>Subtotal</label> <span class=\"price-amount\">\n   {{arrOrder.sub_total.formatted}}\n</span></li> <li><label>Flat Rate</label> <span class=\"price-amount\">\n  {{arrOrder.shipping_cost.formatted}}\n</span></li></ul> <div class=\"order-summary-total\"><label>Total</label> <span class=\"total-price\">\n  {{arrOrder.total.formatted}}\n</span></div></div></div></section>\n\n<app-footer1></app-footer1>";

