/***/ 78666:
/*!*****************************************************************************!*\
  !*** ./src/app/pages/return-policy/return-policy.component.html?ngResource ***!
  \*****************************************************************************/
/***/ (function(module) {

"use strict";
module.exports = "<section class=\"custom-page-wrap clearfix\">\n  <div class=\"container\"><div class=\"custom-page-content clearfix\">\n    <h1 style=\"text-align: center;\">Exchange &amp; Shipping Policy</h1> \n    <p>&nbsp;</p> <p>At <a href=\"javascript:void(0)\">Cartigo.in</a>,\n       orders once processed and the products has been shipped by the dealer/manufacturer, cannot be returned under any cost. \n       For any related questions please contact the support team.</p> <p>&nbsp;</p> <p><a href=\"javascript:void(0)\">Cartigo.in</a>\n         has the complete authority to withhold/cancel the order without successful delivery, for which customer may or may not be provided with the suitable answers.</p> \n         <p>&nbsp;</p> <p><a href=\"javascript:void(0)\">Cartigo.in</a> will accept exchange of UNWORN MERCHANDISE (<strong>defective products only</strong>) within 24 hours of receipt of your order. \n          If 24 hours have gone by since receipt of your order, unfortunately we can’t offer you an exchange.</p> <p>To be eligible for an exchange, your item must be unused and in the same condition that you received it. It must also be in the original packaging.</p> <p>To complete your exchange, we require a receipt or proof of purchase.</p> <p>&nbsp;</p>\n <h4><span style=\"color: rgb(90, 93, 157);\">Exchange (If applicable)</span></h4> <p>Once your exchange product is received and inspected, we will send you an email to notify you that we have received your returned item. We will also notify you of the approval or rejection of your exchange. If you are approved, then your exchange will be processed, \n   and a coupon of the same value will automatically be applied to your account, which can be used to redeem in your next purchase.</p> <ul><li>If you haven’t received a coupon yet, first check your <a href=\"javascript:void(0)\">Cartigo.in</a>&nbsp;account.</li> \n  <li>If you’ve checked your account and you still have not received your coupon yet, please contact us. Our support team will assist you with the unmatched service.</li></ul> <h4>&nbsp;</h4>\n <h4><span style=\"color: rgb(90, 93, 157);\">Shipping</span></h4> <p><a href=\"javascript:void(0)\">Cartigo.in</a>&nbsp;ensures and commit to the timely delivery of the products maintaining the stands of delivery perfections for all the orders placed. We warrant the delivery to be completed within 72 hours. \nAny deviation from this duration will be informed prior to the customer as the products are directly shipped from the Supplier/Manufacturer/Authorized Dealer.</p> <p>&nbsp;</p> <p>All product prices listed in <a href=\"javascript:void(0)\">Cartigo.in</a>&nbsp;are generally exclusive of shipping charges. \nAdditional shipping charges levied by our organization should be considered as a charge for required shipping/additional heavy transportation services which are solely based on the size of the order, the same will be informed prior to shipment.</p> <p>&nbsp;</p> <p>Enlisted documents to be received by the customer will be as follows</p> \n<ul><li>Invoice copy with the detailed purchased product, quantity ordered, price, discount (if any) and shipping cost.</li> <li>User manuals enclosed with the product, if offered by the manufacturer.</li> \n  <li>Material QA check certificates enclosed with the products, if offered by the manufacturer.</li> <li>Installation guides enclosed with the products, if offered by the manufacturer.</li> \n  <li>Guarantee/Warranty cards if any.</li></ul> <p>&nbsp;</p> <p>Tracking of the orders are made simplified and easier at <a href=\"javascript:void(0)\">Cartigo.in</a></p> \n  <ul><li>Go to your account and click on my orders to view your latest and previous orders status.</li> <li>Customers can call on the help line number under contact link to know their status as well.</li>\n  </ul></div></div></section>\n  <app-footer1></app-footer1>";

/***/ }),

